import React from 'react';
import { Link, Outlet } from 'react-router-dom';

function UserProfile({ user }) {
  return (
    <div>
      {user ? (
        <>
          <h2>My Data</h2>
          <p><span style={{ textDecoration: 'underline' }} className="underline">Username:</span> {user.username}</p>
          <p><span style={{ textDecoration: 'underline' }} className="underline">Display Name:</span> {user.display_name}</p>
          <p><span style={{ textDecoration: 'underline' }} className="underline">Email:</span> {user.email}</p>
          <p><span style={{ textDecoration: 'underline' }} className="underline">Phone:</span> {user.phone}</p>
          <nav>
            <ul>
              <li><Link to="MyAds">My ads</Link></li>
              <li><Link to="MyFavorites">My favorites</Link></li>
            </ul>
          </nav>
          <Outlet />
        </>
      ) : (
        <p>Login to view profile</p>
      )}
    </div>
  );
}

export default UserProfile;
